INSERT INTO `pages` (`id`, `title`, `body`, `show_mobile`, `created_at`, `updated_at`) VALUES
(1, 'سياسة الخصوصية', '<p>الديباجة :</p><p>يسعى أَوْلِمْ دوت نت للمحافظة على سرية بيانات المستخدمين و الحفاظ عليها وعدم السماح لأي جهات خارجية بالحصول عليها .</p><p>أَوْلِمْ دوت نت سيسعى لحماية مستخدميه ويحاول جاهداً للحفاظ على سرية البيانات من أي محاولات للاختراق أو ما شابه.</p><p>&nbsp;</p><p>تحديد الموقع :</p><p>يحق لأوْلِمْ دوت نت تحديد موقع العميل بغرض تحسين مستوى الخدمات المقدمة للعميل فقط ولا يحق له استخدامها خارج هذا النطاق.</p><p>&nbsp;</p><p>سرية البيانات :</p><p>لا يحق لأوْلِمْ دوت نت مشاركة بيانات مستخدمينه مع أية أطراف خارجية ولا يمكن استخدام هذه البيانات الا من فريق الدعم الخاص بأولم دوت نت وداخل نطاق العمل.</p><p>&nbsp;</p><p>معلومات الاتصال الخاصة بالعميل :</p><p>يحق لأَوْلِم دوت نت استخدام هذه المعلومات بغرض تقديم العروض و التواصل مع العملاء بهدف تحسين مستوى الخدمة المقدمة والرد على الاستفسارات و الشكاوى كما يحق له استخدام هذه البيانات لتظهر لمقدمي الخدمة للتواصل مع العميل في حال الحاجة الى ذلك.</p><p>&nbsp;</p><p>صورة العميل :</p><p>يحق لأولمْ دوت نت استخدام صورة العميل بغرض التعرف عليه من قبل مقدمي الخدمة كما لا يجوز مشاركة هذه الصور مع أية جهات أخرى ولا تستخدم هذه الصور بغير هدفها الأساسي.</p><p>&nbsp;</p><p>معلومات العميل عند استلام الطلب :</p><p>يقوم أَوْلِم دوت نت باستخدام بيانات العميل بغرض تسليم وتجهيز الطلب عند وصوله .</p><p>&nbsp;</p><p>معلومات السيارة عند الوصول :</p><p>يقوم أَوْلِم دوت نت باظهار بيانات سيارة العميل المحددة عند انشاء الطلب بغرض تسهيل التعرف عليه عند وصوله .</p><p>&nbsp;</p><p>البطاقات الائتمانية :</p><p>يلتزم أَوْلِم دوت نت بالحفاظ على سرية بيانات بطاقات العملاء وحمايتها من الاستخدام بغير أهدافها الأساسية.</p><p>&nbsp;</p><p>تحديث سياسة الخصوصية :</p><p>&nbsp;يحق لأوْلِم دوت نت تحديث سياسة الخصوصية ويعتبر استخدام العميل للتطبيق موافقة منه على أية تحديثات تطرأ على هذه السياسة وتعتبر متابعة هذه التحديثات هي مسؤولية العميل وحده .</p><p>&nbsp;</p><p>مشاركة تجارب العملاء :</p><p>يحق لأولم دوت نت مشاركة تجارب العملاء واظهار اسم العميل كما تعتبر موافقة العميل على التقييم موافقة منه على هذا البند .</p>', 1, '2020-11-25 09:13:17', '2021-05-14 11:03:07'),
(2, 'الشروط والأحكام', '<h2>الشروط والأحكام اولم دوت نت</h2><p>يوفر موقع اولم هذه الشروط والأحكام لتبليغكم بالسياسة والممارسات القانونية للموقع, ويرجى أن تراجع هذه الشروط والأحكام بعناية قبل إستخدام هذا الموقع الإلكتروني فإن إستخدامك لهذا الموقع الإلكتروني يعنى موافقة لا رجعة فيها منك بأن تلتزم بهذه الشروط والأحكام كما تعتبر موافقة منك على أية تعديلات تطرأ عليهاز</p><h3>القواعد الحاكمة</h3><p>عدم مخالفة القوانين السارية أو تحريض الآخرين على انتهاكها مع مراعاة عدم السب والقذف والمضايقة وإنتهاك حقوق الآخرين من خلال التعليقات ووسائل الإتصال المتاحة.</p><h3>حماية البيانات</h3><p>أي معلومات شخصية تزودنا بها عند إستخدامك لهذا الموقع سوف تعامل وفقاً لسياسة الخصوصية الموجودة لدينا.</p><h3>حقوق الملكية</h3><h3>&nbsp;</h3><p>ان ملكية هذا التطبيق تعود الى أولم دوت نت و أن أي استخدامات لأية معلومات من قبل العميل يعتبر اقرارا منه على أنها تعود اليه&nbsp;</p><h3>الإستخدام الأمثل</h3><p>لا يجوز لك إستخدام هذا الموقع إلا وفقاً لهذه الشروط والأحكام على أية حال, ولأغراض مشروعة وسليمة, والتي تتضمن الإمتثال لجميع القوانين واللوائح ومدونات قواعد الممارسات السارية داخل المملكة العربية السعودية أو أي دائرة اختصاص أخرى تكون متصلاً منها بهذا الموقع. بالإضافة إلي عدم إرسال رسائل عشوائية بالبريد الالكتروني إلي أي شخص, وعدم تحميل أو إرفاق ملفات تحتوي علي فيروسات أو ملفات غير سليمة أو ما شابه من البرامج الضارة التي تدمر نظام تشغيل جهاز كمبيوتر لشخص أخر.</p><h3>حدود المسئولية</h3><p>أولم دوت نت هو منصة مرتبط مع أطراف آخرين لخدمة العميل ووفق خدمات التطبيق و الموقع الالكتروني فقط كما تجب الاشارة الى اننا لا نقوم باعداد الطعام وانما نقوم بتحويل طلباتكم الى الجهة التي قمتم بالطلب منها. كما تعتبر هذه المسؤولية مسؤولية المطعم و العميل في حال تقصير اي من الأطراف بواجباته نحو الطرف الآخر. ولا يجوز للمنشأة ان تخطر العميل بجاهزية الطلب ما لم تكن كذلك كما يحق لهم تأجيل وقت الاعداد مع اخطار العميل عن طريق تعديل الوقت المتوقع في لوحة الطلب التي تظهر للعميل</p><h3>تنازل عن الضمان</h3><p>نحن نقدم هذا الموقع ” على حاله ” و ” كما هو متاح ” ، وبالرغم من أننا نسعى جاهدين للحفاظ على دقة محتوى هذا الموقع فإن هذا الموقع مقدم دون أى ضمانات أو شروط صريحة أو ضمنية أو قانونية, أو من أي نوع آخر, ونحن على وجه التحديد نتنصل من كل الضمانات الضمنية للإسم والرواج والملائمة لغرض معين وعدم التعدي إلى أقصى حد يسمح به القانون.</p><h3>تعويضنا عن الأضرار</h3><p>أنت توافق على تعويضنا عن الأضرار والحفاظ علينا مؤَّمنين عن وضد كل التكاليف أو المطالبات أو المطالب أو الالتزامات أو المصروفات أو الأضرار أو الخسائر (بما في ذلك وبدون حصر الخسائر المترتبة, خسائر الأرباح وخسائر السمعة, وجميع الفوائد والغرامات والتكاليف والمصروفات القانونية والمهنية الأخرى) التي تنشأ عن أو تتصل بخرقك لهذه الشروط والأحكام.</p><h3>&nbsp;</h3><p>&nbsp;</p><h3>قابلية الأحكام والشروط للتجزئة</h3><p>إذا كان أى حكم (أو جزء منه) من هذه الشروط والأحكام يعتبر غير قانوني وباطل أو لأي سبب آخر غير قابل للتنفيذ فعندئذٍ يعتبر ذاك الحكم حكماً منفصلاً عن هذه الشروط والأحكام ولا يؤثر على صحة ونفاذ أي من الأحكام الباقية.</p><h3>الإخطار بالتغييرات</h3><p>نحن نحتفظ بالحق في تغيير الشروط والأحكام الخاصة بموقعنا في أي وقت ودون إخطار مسبق, ومواصلتك دخول الموقع أو إستمرارك في إستخدامه بعد هذه التغييرات يعنى قبولكم بالشروط والأحكام بعد تعديلها، ومن مسئوليتكم مراجعة الشروط والأحكام بإنتظام.</p><p><br>&nbsp;</p><h2>سياسة استرجاع الأموال&nbsp;</h2><p>لا يحق للعميل استرجاع الأموال التي دفعت عن طريق الدفع الالكتروني للمنشآت في حال عدم استلامهم للطلب وتعتبر هذه مسؤولية العميل وحدة. كما يحق لهم التواصل مع المنشآت مباشرتا وفي حال موافقتهم بذلك فمن الممكن استعادة الأموال الى العميل.</p><p>&nbsp;</p><p>وفي حال وجود أي عيب بالطلب فانه يحق للعميل رفع شكوى بذلك</p><p>&nbsp;</p><h3>شروط الاستبدال والاسترجاع:-</h3><h3>&nbsp;</h3><h3>&nbsp;</h3><p>لا يمانع أولم دوت نت في استرجاع الطلب في حال موافقة مقدم الخدمة من المنشآت بذلك وهي ترتبط بالعميل و المنشأة مقدمة الخدمة.</p><p>&nbsp;</p><h3>&nbsp;</h3><p>&nbsp;</p><p>&nbsp;</p><h3>&nbsp;ما هي المناطق التي يعمل فيها أولم دوت نت ؟‎</h3><p>- تتوفر خدماتنا في المناطق الرئيسية في المملكة العربية السعودية، يمكنك الاطلاع على المناطق الرئيسية الخاضعة للخدمة من هنا.</p><p>حاليا في المدينة المنورة وستكون في المستقبل القريب في جميع مناطق المملكة باذن الله</p><p>&nbsp;</p><h3>&nbsp;</h3><h3>هل يتوجب علي دفع رسوم إضافية مقابل الخدمات ؟</h3><p>&nbsp;</p><h3>&nbsp;</h3><p>لن يتم تحصيل رسوم الخدمة من العميل الا عند ظهورها في فاتورة الطلب داخل التطبيق ويعتبر اتمام الطلب من العميل موافقتا منه على ذلك.</p>', 1, '2020-11-25 09:13:17', '2021-05-14 11:30:44'),
(5, 'سياسة الطلبات', '<p>سياسة الطلبات</p>', 0, '2021-05-05 07:23:34', '2021-05-14 11:00:15'),
